import React from 'react'

class Nav extends React.Component{
    constructor(){
        super();
        this.state={
            display:false
        }
        this.LogIn=this.LogIn.bind(this);
    }
    LogIn=()=>{
        console.log('Clicked')
        return(
            this.setState({
                display:true
            })
        )
    }
    render(){
        return(
            <div>
            <div id='Nav'>
                <button className='userbtn' onClick={this.LogIn}>LogIn</button>
                <button  className='userbtn'>SignUp</button>
            </div>
            <div>
                {this.state.display?<div id='loginbox'>
                        <input type='text' placeholder='Username' />
                        <input type='Password' placeholder='Password' />
                        <button>Submit</button>
                </div>:<div></div>}
            </div>
            </div>
        )
    }
}
export default Nav
